import '../../index.css'
import 'bootstrap/dist/css/bootstrap.min.css';
import Header from '../../Components/Components-Header/Header-Component';
import TheLastRestComponent from '../../Components/Components-Game/TheLastRest-Component';
import Footer from '../../Components/Components-Footer/Footer-Component';
import BackToTopButton from '../../Components/Components-BackToTopButton/BackToTopButton-Component';

function TheLastRest_page() {
    return (
      <div className='App'>
        <Header/>
        <TheLastRestComponent/>
        <Footer/>
        <BackToTopButton />
      </div>
    );
  }

  export default TheLastRest_page;
